import React from 'react'
import { Container } from 'react-bootstrap'

const footer = () => {
    return (
        <>

     <Container>
        <Row>
            <Col className='text-centre'>
            Copyright  &copy;
            </Col>
        </Row>
     </Container>


        </>
    )
}

export default footer
